import React from "react";
import { View, Image, StyleSheet } from "@react-pdf/renderer";

import "./index.css"

export function HeaderBackground({ img }) {

    return (
        <View style={styles.container}>
            {img === '' ?
                <View style={styles.background} />
                :
                <Image style={styles.background} src={img} />
            }
        </View>

    )
}

export function HeaderBackground2({ img }) {

    return (
        <div className="headerBackgroundContainer">
            {img === '' ?
                <div className="headerBackground">
                </div> :
                <img className="headerBackground" src={img} />
            }

        </div>
    )

}

const styles = StyleSheet.create({
    container: {
        width: '100%',
        height: 90
    },
    background: {
        width: '100%',
        height: 'auto'
    }

})
